import logo from './logo.svg';
import './App.css';
import Favourite from './components/favourites';
import Meals from './components/meals';
import Modal from './components/modal';
import Search from './components/search';

function App() {
  return (
    <main>
      <Favourite/>
      <Meals/>
      <Modal/>
      <Search/>
    </main>
  );
}

export default App;
